INSERT [dbo].[ResumeSkills] ([Id], [CreatedOn], [ResumeId], [SkillId], [SkillLevel], [Justification], [IsActive], [LastUsed], [UsedWith]) VALUES (1, CAST(N'2025-11-27T04:19:28.703' AS DateTime), 1, 9, 8, N'Alex has around 14 months of professional experience using JavaScript (ES6+) as the primary language for front-end development at Northwind Digital Labs. He is described as ''Advanced'' in JavaScript and has built complex UI components, utilities (debounce/throttle/router), and participated in architectural decisions in multiple projects such as React and Angular-based applications, as well as his personal project TaskFlow Pro. His consistent use of modern JavaScript features (ES6+) in both professional and personal contexts, including contributions to design systems and complex state management, supports a senior level for his tenure. Last used in his current position.', 1, NULL, N'React and React Native component development at Northwind Digital Labs (Jun 2023Present), TaskFlow Pro (Angular 17 personal project), Campus Event Explorer (capstone, University of Oregon), Interactive Resume Site and various JavaScript utilities')
GO
